import React from 'react';
import Position from "../components/position";
import "./352style.css";
function Formation352() {

  const players = [
    "player1",
    "player2",
    "player3",
    "player4",
    "player5",
    "player6",
    "player7",
    "player8",
    "player9",
    "player10",
    "player11"
  ];

  const roles = [
    "role",
    "role",
    "role",
    "role",
    "role",
    "role",
    "role",
    "role",
    "role",
    "role",
    "role"
  ]

  const roleToPositionMapping = {
    [players[10]]: [roles[10]],
    [players[9]]: [roles[9]],
    [players[8]]: [roles[8]],
    [players[7]]: [roles[7]],
    [players[6]]: [roles[6]],
    [players[2]]: [roles[2]],
    [players[5]]: [roles[5]],
    [players[4]]: [roles[4]],
    [players[3]]: [roles[3]],
    [players[0]]: [roles[0]],
    [players[1]]: [roles[1]],
  };

  const handleRoleChange = (role) => {
    // Do something with the selected role
    console.log("Selected role:", role);
  };

  return (
    <div className="formation352">
      <div className="attackLane352">
        <Position playerName={players[0]} positionName="ATTACK" roles={roles}
          onRoleChange={handleRoleChange}  />
        <Position playerName={players[1]} positionName="ATTACK" roles={roles}
          onRoleChange={handleRoleChange}  />
      </div>
    </div>

  );
}

export default Formation352;
